pragma solidity 0.8.17;

import "../CoinMachine.sol";
import "../Whitelist.sol";
import "./CoinMachineFactoryStorage.sol";


contract CoinMachineFactory is CoinMachineFactoryStorage {
  receive() external payable {}

  // Public

  function deployCoinMachine(bytes32 _agreementHash) external {
    require(agreementHash == _agreementHash, "coin-machine-factory-bad-signature");

    CoinMachine coinMachine = new CoinMachine(msg.sender, feeFraction, wrappedToken);

    emit CoinMachineDeployed(msg.sender, _agreementHash, address(coinMachine));
  }

  function deployWhitelist(bool _useApprovals, string memory _agreementHash) external {
    Whitelist whitelist = new Whitelist(msg.sender, _useApprovals, _agreementHash);

    emit WhitelistDeployed(msg.sender, address(whitelist));
  }

  // View

  function getAgreementHash() external view returns (bytes32) {
    return agreementHash;
  }

  function getFeeFraction() external view returns (uint256) {
    return feeFraction;
  }

  function getWrappedToken() public view returns (address) {
    return wrappedToken;
  }

  // Owner

  function setAgreementHash(bytes32 _agreementHash) external onlyOwner {
    agreementHash = _agreementHash;

    emit AgreementHashSet(_agreementHash);
  }

  function setFeeFraction(uint256 _feeFraction) external onlyOwner {
    require(_feeFraction <= WAD, "factory-invalid-fraction");
    feeFraction = _feeFraction;

    emit FeeFractionSet(_feeFraction);
  }

  function setWrappedToken(address _wrappedToken) public onlyOwner {
    wrappedToken = _wrappedToken;

    emit WrappedTokenSet(_wrappedToken);
  }

  function withdraw(address _token) external onlyOwner {
    uint256 balance = ERC20(_token).balanceOf(address(this));
    require(ERC20(_token).transfer(owner(), balance), "factory-transfer-failed");
  }
}
